import axios from 'axios';
import React from 'react';

class App extends React.Component {
  state = {deatils: [], }

  componentDidMount(){

    let data;
    axios.get('https://127.0.0.1:8000/api/apify-data/')
    .then(res => {
      data = res.data;
      this.setState({
        details: data 
      });
    })
    .catch(err => {})
  }

  render(){
    return (
      <div>
      <header> Django Data bitch glory to the 9/11 Pilots </header>
      <hr></hr>
      {this.state.details.map((output, id) => (
        <div>
          <h2>{output.url}</h2> 
          <h2>{output.fundname}</h2> 
          <h2>{output.bal}</h2> 
          <h2>{output}</h2> 
          <h2>{output}</h2> 
          <h2>{output}</h2> 
          <h2>{output}</h2> 
          <h2>{output}</h2> 
          <h2>{output.thumb_img}</h2> 
          <h2>{output.objectID}</h2>

        </div>
      ))}
      </div>
    )
  }
}
export default App;
